# -*- coding: utf-8 -*-
# Problem: https://uva.onlinejudge.org/index.php?option=com_onlinejudge&Itemid=8&category=124&page=show_problem&problem=1171
# Total test: 1
# Input: 12 1
# Output: 3
# Input: 25 20
# Output: 0
# Input: 10 9
# Output: 1


def main():
    n, s = map(int, input().split())
    count = 0
    for i in range(1, n + 1):
        if i - sum(map(int, list(str(i)))) >= s:
            count += 1
    print(count)


if __name__ == '__main__':
