def sum_digits(n):
    s = 0
    while n > 0:
        s += n % 10
        n //= 10
    return s


def solve(n, s):
    cnt = 0
    for i in range(1, n + 1):
        if i - sum_digits(i) >= s:
            cnt += 1
    return cnt


n, s = map(int, input().split())
print(solve(n, s))














































































































































































































































































































































































































































































































































